// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Platform {
    Election[] private elections;
    Poll[] private polls;

    mapping(address => uint[]) private userPolls;

    function getAllElections() external view returns (Election[] memory) {
        return elections;
    }


    function getMyPolls() external view returns (uint[] memory) {
        address user = msg.sender;

        return userPolls[user];
    }

    function createPoll() external {
        address user = msg.sender;

        Poll poll = new Poll(user);
        polls.push(poll);

        userPolls[user].push(polls.length);
    }
}

contract Election {
    struct Candidate {
        string name;
        string description;
        uint voteCount;
    }

    address public chairperson;
    Candidate[] public candidates;
    mapping(address => bool) public hasVoted;
    bool public ended = false;
    uint endDate;

    event LogVote(address indexed voterAddress, string name, uint votes);

    modifier onlyChairperson() {
        require(msg.sender == chairperson, "You must be the chairperson");
        _;
    }

    modifier hasNotVoted() {
        require(hasVoted[msg.sender] == false, "You can only vote once!");
        _;
    }

    modifier electionNotEnded() {
        if (block.timestamp > endDate) {
            ended = true;
        }

        require(ended == false, "This election has ended");

        _;
    }

    constructor() {
        chairperson = msg.sender;
    }

    function vote(uint candidate) public hasNotVoted {
        address voter = msg.sender;
        hasVoted[voter] = true;
        candidates[candidate].voteCount++;

        emit LogVote(
            voter,
            candidates[candidate].name,
            candidates[candidate].voteCount
        );
    }

    function getWinner() public view returns (Candidate memory winner) {
        require(candidates.length > 0, "No candidates present");

        uint max = 0;
        for (uint i = 0; i < candidates.length; i++) {
            if (candidates[i].voteCount > max) {
                max = candidates[i].voteCount;
                winner = candidates[i];
            }
        }

        assert(max > 0);
    }
}

contract Poll {
    address public creator;

    constructor(address _creator) {
        creator = _creator;
    }
}

